import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './signin.css';

const SignIn = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({ 
    correo_electronico: '', 
    contraseña: '' 
  });

  const [formSignUp, setFormSignUp] = useState({ 
    correo_electronico: '', 
    contraseña: '' 
  });

  useEffect(() => {
    async function validate() {
      try {
        const request = await fetch('http://localhost:3000/validate', {
          credentials: 'include'
        });
        
        if (request.ok) {
          navigate('/table');
        }
      } catch (error) {
        console.error("Error validando sesión:", error);
      }
    }

    validate();
  }, [navigate]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };
  
  const handleChangeSignUp = (e) => {
    setFormSignUp({ ...formSignUp, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const request = await fetch(
        `http://localhost:3000/login?correo_electronico=${encodeURIComponent(form.correo_electronico)}&contraseña=${encodeURIComponent(form.contraseña)}`,
        {credentials: 'include'}
      );
      
      if (request.ok) {
        alert("Inicio de sesión exitoso");
        navigate('/table');
      } else {
        alert("Usuario o clave incorrecta");
      }
    } catch (error) {
      console.error("Error en login:", error);
      alert("Error de conexión con el servidor");
    }
  };

  const handleSignUp = async (e) => {
    e.preventDefault();
    
    try {
      // Implementa aquí la lógica para registrar un nuevo usuario
      const request = await fetch(
        `http://localhost:3000/register?correo_electronico=${encodeURIComponent(formSignUp.correo_electronico)}&contraseña=${encodeURIComponent(formSignUp.contraseña)}`,
        {credentials: 'include'}
      );
      
      if (request.ok) {
        alert("Registro exitoso");
        // Puedes navegar o limpiar el formulario aquí
      } else {
        alert("Error al registrar");
      }
    } catch (error) {
      console.error("Error en registro:", error);
      alert("Error de conexión con el servidor");
    }
  };

  return (
    <div className="signin-container">
      <img 
        src="/img/logo_coffee_background.png" 
        alt="logo" 
        className="header-image" 
      />
      
      <div className="forms-container">
        {/* Formulario de inicio de sesión */}
        <form className="signin-form" onSubmit={handleSubmit}>
          <h2>Sign In</h2>
          <input
            type="email"
            name="correo_electronico"
            placeholder="Email"
            value={form.correo_electronico}
            onChange={handleChange}
            required
          />
          <input
            type="password"
            name="contraseña"
            placeholder="Password"
            value={form.contraseña}
            onChange={handleChange}
            required
          />
          <button type="submit">Sign In</button>
        </form>

        {/* Formulario de registro */}
        <form className="signup-form" onSubmit={handleSignUp}>
          <h2>Sign Up</h2>
          <input
            type="email"
            name="correo_electronico"
            placeholder="Email"
            value={formSignUp.correo_electronico}
            onChange={handleChangeSignUp}
            required
          />
          <input
            type="password"
            name="contraseña"
            placeholder="Password"
            value={formSignUp.contraseña}
            onChange={handleChangeSignUp}
            required
          />
          <button type="submit">Sign Up</button>
        </form>
      </div>
                      {/* Tabla*/}
                      <table> // Se crea la tabla
          <thead> // Se indica que se crearan encabezados
            <tr> // se define la fila de los encabezados
              <th>correo_electronico</th> // Se define la columna del primer encabezado
              <th>contraseña</th> // Se define la columna del segundo encabezado
            </tr>
          </thead>
          <tbody>
            <tr>
              <th>davidpolo@suca.com</th>
              <th>123</th>
            </tr>
          </tbody>
        </table>
    </div>
  );
};

export default SignIn;
